import routes from '../Config/routes';
const primaryMenus = [
  {
    label: 'Benefits',
    path: routes.benefits,
  },
  {
    label: 'Corporate',
    path: routes.corporate,
  },
  {
    label: 'Resources',
    path: routes.resources,
  },
];

export default primaryMenus;
